import React from 'react'
import './ClassicInput.scss'

function ClassicInput({children, type, backgroundColor, inputColor, labelColor, placeholder}) {
  return (
    <div className="classic-input-container">
        <label style={{color: labelColor}}>{children}</label>
        <input placeholder={placeholder} type={type} style={{backgroundColor: backgroundColor, borderRadius: '10px', color: inputColor}}/>
    </div>
  )
}

export default ClassicInput
